const CHANNEL_ID = 'UCsUaSeJ5deBKVDqLtdCD6Eg';

fetch(
  `https://www.googleapis.com/youtube/v3/search?key=${API_KEY}&channelId=${CHANNEL_ID}&part=snippet,id&order=date&maxResults=1`
)
  .then(res => res.json())
  .then(data => {
    const id = data.items?.[0]?.id?.videoId;
    if (id) setVideoId(id);
  })
